import React, { meomo,useState,useEffect,useRef } from "react";
import MovieName from '../components/testComponent/movieComponent'

const Movie = () =>{
const [count,setCount] = useState(0); 
const [name, setName] = useState("정준일"); 
console.log('Movie'); 
return (

    
    <div>
    <MovieName name={name}/>
    <input type="button" value='clickc' onClick={()=>setCount(count+1)} /> 
    {count}
    <input type="button" value='clickcName' onClick={()=>setName('hello')} /> 
     
    </div>
)
}
export default meomo(Movie);
